  {id: 363, course_id: 196, professor_id: 601, created_at: "2018-01-07 16:16:49", updated_at: "2018-01-07 16:23:26", content: "In a cultural climate saturated by technology, marketing professionals have focused their energies on creating newer and more digital methods of advertising their brands, with the fear that if they don't embrace \"Big Data,\" they will fade into obscurity. But Tom Doctoroff, renowned author, ex-CEO for J. Walter Thompson Asia Pacific and current Senior Parter for global brand and marketing consultancy Prophet, argues that this frenzy over digital and social media has created a schism in the marketing world that is hindering brands from attaining their true growth potential.\nThe tension between traditional branding and the seemingly unlimited possibilities presented by the advent of \"digital\" branding leads companies to abandon the tried and true aspects of marketing -- consumer insight rooted in human and cultural truths, an enduring brand purposes, creative ideas that invite participation, and customer experience that deepens brand relationships -- for the flash of the new. In Building Global Brands, Doctoroff outlines a framework that truly integrates the two approaches as the best way for any brand to thrive in the future. Using some of the biggest brand names, both American and foreign, as examples, such as Coca-Cola, Nike, and Huawei, he breaks down the essentials of marketing to explain how digital marketing can't stand without the timeless -- or, yes -- traditional foundation."},
  {id: 364, course_id: 195, professor_id: 579, created_at: "2018-01-07 17:02:34", updated_at: "2018-01-07 17:02:34", content: "No course description available."}
